import React from 'react';
import Product from "./product";

export default class Home extends React.Component {
    render() {
        return (
            <div>
                <p>This is the home page.</p>
                <Product
                object={async function getProducts() {
                    let result = await fetch('https://my-json-server.typicode.com/tdmichaelis/json-api/products');
                    let object = await result.json();
                    console.log(object);}}/>
            </div>
        );
    }
}
